let contactImage = <img src={splashPics[1]} alt="block" className="contact-splash-img" id="left"/>


return(
    <section>
    <div className={'contact-card'}>
        {contactImage}
        <div className='connect-card'>
        <p>Connect</p>
        <div className='social-card'>
        {content}
        </div>
        </div>
    </div>
    </section>
    )
}

export default Contact;
